import jsPDF from 'jspdf';
(function (jsPDFAPI) {
    let font = '';
    let callAddFont = function () {
        // @ts-ignore
        this.addFileToVFS('museo-normal.ttf', font);
        // @ts-ignore
        this.addFont('museo-normal.ttf', 'museo', 'normal');
    };
    jsPDFAPI.events.push(['addFonts', callAddFont])
    // @ts-ignore
})(jsPDF.API);
